const BASE_PARAMS = { searchAddress: '528 Kent St, Sydney, NSW, 2000', propertyGroupsMaxResults: Infinity, propertyTypesMaxResults: Infinity, neighboursSearchMaxRecords: Infinity, propertyTypes: [], propertyGroups: [], managed: 'All', readyForSearch: false, id: 'search:953.8344200399587', dateSold: { min: undefined, max: undefined }, salePrice: { min: -1, max: -1 }, saleType: [], rentGross: { min: -1, max: -1 }, rentPerDollarMeter: { min: -1, max: -1 }, leasedDate: { min: undefined, max: undefined }, reviewDate: { min: undefined, max: undefined }, landArea: { min: -1, max: -1 }, buildArea: { min: -1, max: -1 }, heightLimit: { min: -1, max: -1 } }

const DEVELOPED_PROPERTIES = TEST_DATA[0].filter((property) => property.Underdeveloped !== 'No')

describe('filterResults', () => {
    test('no filters set - should return all records except underdeveloped', async () => {
        const params = [BASE_PARAMS]

        const result = await filterResults(TEST_DATA, params, 'BaseFilter')
        expect(result.map((property) => property.id)).toEqual(DEVELOPED_PROPERTIES.map((property) => property.id))
    })

    test('no matching property types or groups - should respect neighbour limit', async () => {
        const params = [{
            ...BASE_PARAMS,
            propertyTypes: ['dsf'],
            propertyGroups: ['dsf'],
            neighboursSearchMaxRecords: 2
        }]

        const result = await filterResults(TEST_DATA, params, 'BaseFilter')
        expect(result.length).toBe(2)
    })

    test('property type filter + neighbour limit - should respect both', async () => {
        const params = [{
            ...BASE_PARAMS,
            propertyTypes: ['Development - Apartment'],
            propertyTypesMaxResults: 3,
            neighboursSearchMaxRecords: 2
        }]

        const result = await filterResults(TEST_DATA, params, 'BaseFilter')
        expect(result.length).toBe(5)
    })

    test('property type + property group filter + neighbour limit - should respect both', async () => {
        const params = [{
            ...BASE_PARAMS,
            propertyTypes: ['Development - Apartment'],
            propertyTypesMaxResults: 3,
            propertyGroups: ['Residential'],
            propertyGroupsMaxResults: 3,
            neighboursSearchMaxRecords: 2
        }]

        const result = await filterResults(TEST_DATA, params, 'BaseFilter')
        expect(result.length).toBe(8)
    })

    test('property type + property group filter + no neighbour limit - should respect both', async () => {
        const params = [{
            ...BASE_PARAMS,
            propertyTypes: ['Development - Apartment'],
            propertyTypesMaxResults: 3,
            propertyGroups: ['Residential'],
            propertyGroupsMaxResults: 3
        }]

        const result = await filterResults(TEST_DATA, params, 'BaseFilter')
        expect(result.length).toBe(6)
    })
})
